class ObjectType {
  static [Symbol.hasInstance](o) {
    return o !== null && typeof o === 'object';
  }
}

function useUpdate(){
  const [, setState] = useState({});
  return useCallback(() => setState({}), [])
}

const oMap = new WeakMap();
const pMap = new WeakMap();
function observer(initialVal, cb) {
  if (oMap.has(initialVal)) oMap.get(initialVal);

  const proxy = new Proxy(initialVal, {
    get(target, key, receiver) {
      const res = Reflect.get(target, key, receiver);
      return res instanceof ObjectType ? observer(res, cb) : res;
    },
    set(target, key, val) {
      const res = Reflect.set(target, key, val);
      cb();
      return res;
    },
    deleteProperty(target, key) {
      const res = Reflect.deleteProperty(target, key);
      cb();
      return res;
    }
  })

  if (pMap.has(proxy)) return pMap.get(proxy);

  oMap.set(initialVal, proxy);
  pMap.set(proxy, initialVal);

  return proxy;
}

function useReactive(initialState) {
  const update = useUpdate();
  const stateRef = useRef(initialState);
  const state = observer(stateRef.current, () => update());
  return state;
}

export default () => {
  const state = useReactive({
    count: 0,
    inputVal: '',
    obj: {
      value: '',
    },
  });

  return (
    <div>
      <p> state.count\uFF1A{state.count}</p>
      <button style={{ marginRight: 8 }} onClick={() => state.count++}>
        state.count++
      </button>
      <button onClick={() => state.count--}>state.count--</button>
      <p style={{ marginTop: 20 }}> state.inputVal: {state.inputVal}</p>
      <input onChange={e => (state.inputVal = e.target.value)} />
      <p style={{ marginTop: 20 }}> state.obj.value: {state.obj.value}</p>
      <input onChange={e => (state.obj.value = e.target.value)} />
    </div>
  );
};`},react:{type:"NPM",value:"18.1.0"}}}}},Et={title:"useReactive",toc:"menu",filename:"docs/react/hooks-custom-use_reactive.md",order:3,group:{title:"hooks-custom"}},et=[],ht=[],Re={},Pe={title:"\u6570\u5B57\u5343\u5206\u4F4D",toc:"menu",filename:"docs/FAQ/RegExp-parse_thousands.md",group:{title:"RegExp"},description:"\u6570\u5B57\u5343\u5206\u4F4D"},Ie=[],be=[{value:"\u6570\u5B57\u5343\u5206\u4F4D",paraId:0},{value:`/**
 * \u6570\u5B57\u5343\u5206\u4F4D
 */
// \u89E31
function parseThousands1(num) {
  const str = num + '';
  const ary = str.split('');

  let decimal = '';
  const index = str.indexOf('.');
  if (index > -1) {
    decimal = ary.splice(index).join('');
  }

  const integer = ary.reverse().reduce((prev, next, index) => {
    return (index % 3 ? next : next + ',') + prev;
  });
  return integer + decimal;
}
// 1234567.89
// console.log(parseThousands1(12345678.12345678));

// \u89E32
function parseThousands2(num) {
  const str = num + '';
  return str.replace(/\\B(?=(\\d{3})+(?!\\d))/g, ',');
}
// console.log(parseThousands2(12345678.12345678));

// \u89E33
function parseThousands3(num) {
  const str = num + '';
  return str.replace(/\\d{1,3}(?=(\\d{3})+($|\\.))/g, $1 => $1 + ',');
}
console.log(parseThousands3(12345678.12345678));






