let workInProgressHook;
let isMount = true;

const fiber = {
  // \u4FDD\u5B58\u8BE5FunctionComponent\u5BF9\u5E94\u7684Hooks\u94FE\u8868
  memoizedState: null,
  // \u6307\u5411App\u51FD\u6570
  stateNode: App
};

function schedule() {
  // \u66F4\u65B0\u524D\u5C06workInProgressHook\u91CD\u7F6E\u4E3Afiber\u4FDD\u5B58\u7684\u7B2C\u4E00\u4E2AHook
  workInProgressHook = fiber.memoizedState;
  // \u89E6\u53D1\u7EC4\u4EF6render
  const app = fiber.stateNode();
  // \u7EC4\u4EF6\u9996\u6B21render\u4E3Amount\uFF0C\u4EE5\u540E\u518D\u89E6\u53D1\u7684\u66F4\u65B0\u4E3Aupdate
  isMount = false
  return app;
}

function dispatchAction(queue, action) {
  // \u521B\u5EFAupdate
  const update = {
    action,
    next: null
  }

  // \u73AF\u72B6\u5355\u5411\u94FE\u8868\u64CD\u4F5C
  if (queue.pending === null) {
    update.next = update;
  } else {
    update.next = queue.pending.next;
    queue.pending.next = update;
  }
  queue.pending = update;

  // \u6A21\u62DFReact\u5F00\u59CB\u8C03\u5EA6\u66F4\u65B0
  schedule();
}

function useState(initialState) {
  let hook;

  if (isMount) {
    hook = {
      queue: {
        pending: null
      },
      memoizedState: initialState,
      next: null
    }
    if (!fiber.memoizedState) {
      fiber.memoizedState = hook;
    } else {
      workInProgressHook.next = hook;
    }
    workInProgressHook = hook;
  } else {
    hook = workInProgressHook;
    workInProgressHook = workInProgressHook.next;
  }

  let baseState = hook.memoizedState;
  if (hook.queue.pending) {
    let firstUpdate = hook.queue.pending.next;

    do {
      const action = firstUpdate.action;
      baseState = action(baseState);
      firstUpdate = firstUpdate.next;
    } while (firstUpdate !== hook.queue.pending.next)

    hook.queue.pending = null;
  }
  hook.memoizedState = baseState;

  return [baseState, dispatchAction.bind(null, hook.queue)];
}

function App() {
  const [num, updateNum] = useState(0);

  return <p onClick={() => updateNum(num => num + 1)}>{num}</p>;
}

export default App;`},react:{type:"NPM",value:"18.1.0"}}}}},Gs={title:"useState",toc:"menu",filename:"docs/react/hooks-useState.md",order:1,group:{title:"hooks"}},ns=[],Vs=[],Ks={},nc={title:"\u4F18\u5316",toc:"menu",filename:"docs/webpack/optimization.md",group:{title:"optimization"},description:"hash"},xo=[{id:"\u6301\u4E45\u5316\u7F13\u5B58",depth:6,title:"\u6301\u4E45\u5316\u7F13\u5B58"},{id:"\u9884\u7F16\u8BD1",depth:6,title:"\u9884\u7F16\u8BD1"},{id:"tree-shaking",depth:6,title:"Tree Shaking"},{id:"\u7F13\u5B58",depth:6,title:"\u7F13\u5B58"},{id:"\u591A\u8FDB\u7A0B\u6253\u5305",depth:6,title:"\u591A\u8FDB\u7A0B\u6253\u5305"},{id:"alias-\u8DEF\u5F84\u522B\u540D",depth:6,title:"alias \u8DEF\u5F84\u522B\u540D"},{id:"noparse-\u4E0D\u89E3\u6790\u548C\u8F6C\u6362\u672A\u9075\u5FAA-commonjs-\u89C4\u8303\u7684\u6A21\u5757",depth:6,title:"noParse \u4E0D\u89E3\u6790\u548C\u8F6C\u6362\u672A\u9075\u5FAA CommonJS \u89C4\u8303\u7684\u6A21\u5757"}],tr=[{value:"hash",paraId:0,tocIndex:0},{value:"hash \u8BA1\u7B97\u6240\u6709 chunks \u7684 hash\uFF0C\u6BCF\u6B21\u751F\u6210\u4E00\u4E2A\u552F\u4E00\u7684 hash",paraId:1,tocIndex:0},{value:"chunkHash \u4E3A\u6BCF\u4E2A chunk \u8BA1\u7B97 hash\uFF0C\u6837\u5F0F hash \u548C\u5BF9\u5E94\u811A\u672C\u7684 hash \u76F8\u540C",paraId:1,tocIndex:0},{value:"contentHash extract-text-plugin \u4E3A css \u63D0\u4F9B\u7684 hash\uFF0Ccss \u6587\u4EF6 hash \u53EA\u8DDF\u672C\u8EAB\u6709\u5173",paraId:1,tocIndex:0},{value:"module id",paraId:2,tocIndex:0},{value:"\u76EE\u7684\uFF1Amodule id \u4F1A\u57FA\u4E8E\u9ED8\u8BA4\u7684\u89E3\u6790\u987A\u5E8F\u589E\u91CF\uFF0C\u589E\u5220\u6587\u4EF6\u4E4B\u540E\u6587\u4EF6\u5BF9\u5E94 hash \u503C\u4F1A\u53D1\u751F\u53D8\u5316",paraId:3,tocIndex:0},{value:"\u89E3\u51B3\u65B9\u6848\uFF1A",paraId:3,tocIndex:0},{value:`
